import React from 'react'
import {Grid, Paper} from '@mui/material'
 
export default function RegistrarUsuario() {
  const paperStyle= {padding: '30px 20px'}
  return(
    <Grid>
      <Paper elevation={20} style={paperStyle}>
        <h2>Registro</h2>
      </Paper>
    </Grid>
  )
}
